  \"2015-04-30T15:29:22.781903\",\n\t\"name\": \"waterbird-census-summary-2007\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This summarizes the waterbird survey work
  done at Patuxent Research Refuge in 2007. After the record low in 2006, Canada geese
  populations returned to near the ten year average. Ringneck ducks reached a record
  high, 25 percent above the ten year average. Mallards and hooded mergansers recorded
  record lows. Black ducks were near average, and for the first time ever, exceeded
  mallards in the Fall Quarter. Wood duck populations were near average. Other duck
  species as a group were well below average. Wading birds were about average. Shorebirds
  were 50 percent below average.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
